import React, { useRef } from "react";
import { motion, useInView } from "framer-motion";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
  faUtensils, 
  faCalendarCheck, 
  faTruckFast, 
  faHeart
} from '@fortawesome/free-solid-svg-icons';

export default function HowItWorks() {
  const containerRef = useRef(null);
  const isInView = useInView(containerRef, { once: false, amount: 0.2 });

  const steps = [
    {
      number: 1,
      title: "Browse & Select",
      description: "Browse and select a plan, meal type, and check availability in your location. Choose meals that match your taste and dietary preferences.",
      icon: faUtensils,
      accentColor: "bg-primary/20",
      iconColor: "text-primary"
    },
    {
      number: 2,
      title: "Schedule Your Delivery",
      description: "Schedule your delivery, manage orders with complete transparency. No commitments - you're free to modify or cancel anytime.",
      icon: faCalendarCheck,
      accentColor: "bg-primary/20",
      iconColor: "text-primary"
    },
    {
      number: 3,
      title: "Doorstep Delivery",
      description: "Receive your freshly prepared meals right at your doorstep. Our delivery team ensures your food arrives in perfect condition.",
      icon: faTruckFast,
      accentColor: "bg-primary/20",
      iconColor: "text-primary"
    },
    {
      number: 4,
      title: "Enjoy Your Meal",
      description: "Simply unpack and enjoy your delicious, home-style meal. Please keep updating your feedback with us to help us serve you better.",
      icon: faHeart,
      accentColor: "bg-primary/20",
      iconColor: "text-primary"
    }
  ];

  return (
    <section id="how-it-works" className="py-20 md:py-32 bg-gradient-to-b from-gray-50 to-white overflow-hidden section-fade">
      <div className="container mx-auto px-4 md:px-6">
        <div className="text-center max-w-3xl mx-auto mb-16 md:mb-24">
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6 }}
          >
            <h2 className="text-3xl md:text-5xl font-bold mb-6 text-gray-900 tracking-tight">
              How It Works
            </h2>
            <p className="text-xl text-gray-600 leading-relaxed">
              Experience a seamless journey from selection to satisfaction with our simple process.
            </p>
          </motion.div>
        </div>

        <div ref={containerRef} className="relative">
          {/* Interactive timeline */}
          <div className="absolute top-24 md:top-36 left-4 md:left-1/2 h-[calc(100%-8rem)] md:h-auto md:w-[calc(100%-8rem)] border-l-2 md:border-l-0 md:border-t-2 border-primary/30 md:transform md:-translate-x-1/2 z-0"></div>

          <div className="space-y-24 md:space-y-0 md:grid md:grid-cols-2 lg:grid-cols-4 md:gap-8">
            {steps.map((step, index) => (
              <motion.div
                key={index}
                className="relative"
                initial={{ opacity: 0, y: 50 }}
                animate={isInView ? { opacity: 1, y: 0 } : { opacity: 0, y: 50 }}
                transition={{ duration: 0.6, delay: index * 0.2 }}
              >
                {/* Step number with pulse effect */}
                <div className="absolute top-0 left-0 md:left-1/2 md:top-0 transform translate-x-3 md:-translate-x-1/2 md:-translate-y-8 z-20">
                  <div className="relative">
                    <div className="w-16 h-16 bg-primary text-white rounded-full flex items-center justify-center text-xl font-bold shadow-lg">
                      {step.number}
                    </div>
                    <motion.div
                      className="absolute inset-0 rounded-full bg-primary/30"
                      animate={{ 
                        scale: [1, 1.5, 1],
                        opacity: [0.7, 0.2, 0.7]
                      }}
                      transition={{
                        duration: 2,
                        repeat: Infinity,
                        ease: "easeInOut"
                      }}
                    ></motion.div>
                  </div>
                </div>

                <div className="pt-6 pl-12 md:pl-0 md:pt-12 md:px-4">
                  {/* Visual icon representation with improved visuals */}
                  <div className="mb-6 rounded-xl overflow-hidden shadow-lg transform transition-all duration-300 hover:scale-105 h-56">
                    <div className="w-full h-full relative bg-gray-50 flex items-center justify-center">
                      {/* Floating accent circles for visual interest */}
                      <motion.div 
                        className="absolute -bottom-6 -right-6 w-24 h-24 rounded-full bg-primary/10 opacity-20 blur-xl"
                        animate={{ 
                          scale: [1, 1.2, 1],
                          opacity: [0.2, 0.3, 0.2] 
                        }}
                        transition={{ 
                          duration: 4,
                          ease: "easeInOut",
                          repeat: Infinity,
                          delay: index * 0.5
                        }}
                      ></motion.div>

                      <motion.div 
                        className="absolute top-4 -left-4 w-16 h-16 rounded-full bg-primary/10 opacity-30"
                        animate={{ 
                          x: [0, 10, 0],
                          y: [0, -10, 0],
                          opacity: [0.3, 0.5, 0.3] 
                        }}
                        transition={{ 
                          duration: 5,
                          ease: "easeInOut",
                          repeat: Infinity,
                          delay: index * 0.3
                        }}
                      ></motion.div>

                      {/* Main icon with glowing effect */}
                      <div className="relative">
                        <FontAwesomeIcon 
                          icon={step.icon} 
                          className="w-20 h-20 text-primary drop-shadow-lg" 
                        />
                        <motion.div
                          className="absolute inset-0 blur-lg opacity-50"
                          animate={{ 
                            opacity: [0.5, 0.8, 0.5]
                          }}
                          transition={{
                            duration: 2,
                            repeat: Infinity,
                            ease: "easeInOut"
                          }}
                        >
                          <FontAwesomeIcon 
                            icon={step.icon} 
                            className="w-20 h-20 text-primary" 
                          />
                        </motion.div>
                      </div>
                    </div>
                  </div>

                  {/* Step content - Fixed height to make all boxes the same size */}
                  <div className="bg-white rounded-xl p-6 shadow-md border border-gray-100 h-48">
                    <h3 className="text-xl font-semibold mb-3">{step.title}</h3>
                    <p className="text-gray-600 text-sm">{step.description}</p>
                  </div>
                </div>
              </motion.div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
}
